    [],nt"revision_timestamp": "2016-07-27T22:41:59.824681",nt"name": "environmental-contaminant-surveys-in-three-national-wildlife-refuges-in-wyoming",nt"isopen":
    false,nt"url": null,nt"notes": "Environmental contaminants surveys were
    conducted at National Elk, Seedskadee, and Hutton Lake National Wildlife Refuges
    (NWR) to provide information on existing conditions to identify potential habitat
    quality problems, and to determine if non-point sources of pollution may be affecting
    the refuges. Pondweed (Potamogeton spp.) samples from Hutton, Rush, and Creighton
    Lakes and Lake George at Hutton Lake NWR and Hay Farm Pond at Seedskadee NWR had
    boron concentrations greater than 300 ug/g dry weight, the level suspected of causing
    reduced growth in mallard ducklings (Eisler 1990). The source of the boron is unknown.
    One pondweed sample from Flat Creek at the National Elk Refuge had a selenium concentration
    of 3.2 ug/g dry weight, slightly above the 3 ug/g level of concern for bioaccumulation
    in fish and wildlife recommended by Lemly and Smith (1987). The source is unknown,
    but runoff from the adjacent highway may account for the selenium. Continued monitoring
    of boron and selenium concentrations in aquatic vegetation and aquatic invertebrates
    is recommended for Seedskadee, Hutton Lake and National Elk NWR's. Specific sites
    in need of monitoring include: Lake George and Creighton Lake at Hutton Lake, Flat
    Creek adjacent to U.S. Highway 89 at the National Elk Refuge, and Hay Farm Pond
    at Seedskadee NWR.",nt"license_title": "License Not Specified",nt"extras":
